package com.rongke.utils.ans;import java.util.LinkedHashSet;import java.util.List;import java.util.Set;public class AListUtils {    /**     *  集合去重 （常量）     * @param stringList     * @return     */    public static List removeStringListDupli(List stringList) {        Set set = new LinkedHashSet<>();        set.addAll(stringList);        stringList.clear();        stringList.addAll(set);        return stringList;    }}